import React, { Component } from 'react';


class About extends Component {
  render() {
    return(
      <div className="about-container">
      <h1>About Me</h1>
      <img alt="profile pic" src="Rusi.png" />
      <br />
      <br />
      <blockquote>Rusilah Gojali! A California native, mother of three boys, juggling the cyber world with the family world! I have this passion for coding because I see coding as an epitome of me; it's detail-oriented, complex, and most importantly, fun! Seeing how coding is found in almost every aspect of our lives, coding has allowed me to express myself in an ever-advancing technological world.</blockquote>
      </div> 
    )
  }
}

export default About;
